import { Component } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-adminpanel',
  templateUrl: './adminpanel.component.html',
  styleUrls: ['./adminpanel.component.css']
})
export class AdminpanelComponent {
  showCustomer: boolean = false;
  showRestaurant: boolean = false;
  showComplaints: boolean = false;
  customers: any[] = [];
  restaurants: any[] = [];
  complaints: any[] = [];
  filteredCustomers: any[] = [];
  filteredRestaurants: any[] = [];
  filteredComplaints: any[] = [];
  customerSearchTerm: string = '';
  restaurantSearchTerm: string = '';
  complaintSearchTerm: string = '';
  currentPage: number = 1;
  pageSize :any;


  constructor(private http: HttpClient) {}

  toggleCustomer() {
    this.showCustomer = !this.showCustomer;
    if (this.showCustomer) {
      this.fetchCustomerDetails();
    }
  }

  toggleRestaurant() {
    this.showRestaurant = !this.showRestaurant;
    if (this.showRestaurant) {
      this.fetchRestaurantDetails();
    }
  }

  toggleComplaints() {
    this.showComplaints = !this.showComplaints;
    if (this.showComplaints) {
      this.fetchComplaints();
    }
  }

  fetchCustomerDetails() {

    this.showComplaints = false;
    this.showRestaurant = false;
    this.http.get<any[]>('https://8081-eaeeecbfecacfcdbccbacbfccbbebfcae.project.examly.io/customer')
      .subscribe(data => {
        this.customers = data;
        this.filteredCustomers = this.customers;
        this.pageSize = this.filteredCustomers.length; // Set the page size based on the number of customers


      });
  }

  fetchRestaurantDetails() {

    this.showCustomer = false;
    this.showComplaints = false;
    this.http.get<any[]>('https://8081-eaeeecbfecacfcdbccbacbfccbbebfcae.project.examly.io/restaurant')
      .subscribe(data => {

        this.restaurants = data;
        this.filteredRestaurants = this.restaurants;
        this.pageSize = this.filteredCustomers.length; // Set the page size based on the number of customers

      });
  }

  fetchComplaints() {

    this.showCustomer = false;
    this.showRestaurant = false;
    this.http.get<any[]>('https://8081-eaeeecbfecacfcdbccbacbfccbbebfcae.project.examly.io/contactus')
      .subscribe(data => {
        this.complaints = data;
        this.filteredComplaints = this.complaints;
        this.pageSize = this.filteredCustomers.length; // Set the page size based on the number of customers

      });
  }

  deleteCustomer(customer: any) {
    this.http.delete(`https://8081-eaeeecbfecacfcdbccbacbfccbbebfcae.project.examly.io/customer/${customer.id}`, { responseType: 'text' })
      .subscribe(() => {
        this.customers = this.customers.filter(c => c.id !== customer.id);
        this.filteredCustomers = this.filteredCustomers.filter(c => c.id !== customer.id);
        window.alert('Customer deleted successfully');
      }, (error: any) => {
        console.error('Error deleting customer:', error);
        window.alert('Failed to delete customer');
      });
  }

  deleteRestaurant(restaurant: any) {
    this.http.delete(`https://8080-cdcccaeacaaacfcdbccbacbfccbbebfcae.project.examly.io/restaurant/${restaurant.id}`, { responseType: 'text' })
      .subscribe(() => {
        this.restaurants = this.restaurants.filter(r => r.id !== restaurant.id);
        this.filteredRestaurants = this.filteredRestaurants.filter(r => r.id !== restaurant.id);
        window.alert('Restaurant deleted successfully');
      }, (error: any) => {
        console.error('Error deleting restaurant:', error);
        window.alert('Failed to delete restaurant');
      });
  }



  deleteComplaint(complaint: any) {
    this.http.delete(`https://8080-cdcccaeacaaacfcdbccbacbfccbbebfcae.project.examly.io/contactus/${complaint.id}`, { responseType: 'text' })
      .subscribe(() => {
        this.filteredComplaints = this.filteredComplaints.filter(c => c.id !== complaint.id);
        window.alert('Complaint deleted successfully');
      }, (error: any) => {
        console.error('Error deleting complaint:', error);
        window.alert('Failed to delete complaint');
      });
  }

  filterCustomers() {
    const searchTerm = this.customerSearchTerm.toLowerCase();
    this.filteredCustomers = this.customers.filter(c => c.name.toLowerCase().includes(searchTerm));
  }

  filterRestaurants() {
    const searchTerm = this.restaurantSearchTerm.toLowerCase();
    this.filteredRestaurants = this.restaurants.filter(r => r.name.toLowerCase().includes(searchTerm));
  }

  filterComplaints() {
    const searchTerm = this.complaintSearchTerm.toLowerCase();
    this.filteredComplaints = this.complaints.filter(
      c => c.name.toLowerCase().includes(searchTerm) ||
        c.email.toLowerCase().includes(searchTerm) ||
        c.message.toLowerCase().includes(searchTerm)
    );
  }
}
<div class="container">
  <div class="after-form-spacing"></div>

  <h2 class="text-center">Welcome to Admin Panel</h2>
  <h5 class="text-center">You can access customer, restaurant, and complaints details here</h5>
  <div class="after-form-spacing1"></div>

  <div class="row">
    <!-- Customer Section -->
    <div class="col-md-4">
      <div class="card">
        <div class="card-header text-center pointer-cursor" (click)="toggleCustomer()">
          <h3>Customer</h3>
        </div>
      </div>
    </div>



    <!-- Restaurant Section -->
    <div class="col-md-4">
      <div class="card">
        <div class="card-header text-center pointer-cursor" (click)="toggleRestaurant()">
          <h3>Restaurant</h3>
        </div>
      </div>
    </div>

    <!-- Complaints Section -->
    <div class="col-md-4">
      <div class="card">
        <div class="card-header text-center pointer-cursor" (click)="toggleComplaints()">
          <h3>Complaints</h3>
        </div>
      </div>
  </div>


    <!-- Customer Data Table -->
    <div class="card-body" *ngIf="showCustomer">

    <div>
      <input type="text" class="form-control mb-3 text-center " placeholder="Search by Customer Name"
        [(ngModel)]="customerSearchTerm" (input)="filterCustomers()">
    </div>
    <div class="table-responsive">
      <table class="table table-bordered">
        <thead>
          <tr>
            <th>Serial No</th>
            <th>Customer ID</th>
            <th>Customer Name</th>
            <th>Customer Email</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          <tr *ngFor="let customer of filteredCustomers; let i = index">
            <td>{{ (currentPage - 1) * pageSize + i + 1 }}</td>
            <td>{{ customer.id }}</td>
            <td>{{ customer.name }}</td>
            <td>{{ customer.email }}</td>
            <td class="text-center">
              <button class="btn btn-danger d-block mx-auto" (click)="deleteCustomer(customer)">Remove</button>
            </td>

          </tr>
        </tbody>
      </table>
    </div>
    <div class="text-center">
      <p>Total Customers: {{ filteredCustomers.length }}</p>
    </div>
  </div>



    <!-- Restaurant Data Table -->

  <div class="card-body" *ngIf="showRestaurant">
    <div>
      <input type="text" class="form-control mb-3 text-center" placeholder="Search by Restaurant Name"
        [(ngModel)]="restaurantSearchTerm" (input)="filterRestaurants()">
    </div>
    <div class="table-responsive">
      <table class="table table-bordered">
        <thead>
          <tr>
            <th>Serial No</th>
            <th>Restaurant ID</th>
            <th>Restaurant Name</th>
            <th>email</th>
            <th>Restaurant Address</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          <tr *ngFor="let restaurant of filteredRestaurants; let index = index">
            <td>{{ (currentPage - 1) * pageSize + index + 1 }}</td>
            <td>{{ restaurant.id }}</td>
            <td>{{ restaurant.name }}</td>
            <td>{{ restaurant.email }}</td>
            <td>{{ restaurant.address }}</td>
            <td class="text-center">
              <button class="btn btn-danger d-block mx-auto" (click)="deleteRestaurant(restaurant)">Remove</button>
            </td>
          </tr>
        </tbody>
      </table>
    </div>
    <div class="text-center">
      <p>Total Restaurants: {{ filteredRestaurants.length }}</p>
    </div>
  </div>



    <!-- Complaints Data Table -->

  <div class="card-body" *ngIf="showComplaints">
    <div>
      <input type="text" class="form-control mb-3 text-center" placeholder="Search by Name, Email, or Message"
        [(ngModel)]="complaintSearchTerm" (input)="filterComplaints()">
    </div>
    <ng-container *ngIf="filteredComplaints.length > 0; else noComplaints">
      <div class="table-responsive">
        <table class="table table-bordered">
          <thead>
            <tr >
              <th>Serial No</th>
              <th>Name</th>
              <th>Email</th>
              <th>Message</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            <tr *ngFor="let complaint of filteredComplaints; let i = index">
              <td>{{ (currentPage - 1) * pageSize + i + 1 }}</td>
              <td>{{ complaint.name }}</td>
              <td>{{ complaint.email }}</td>
              <td>{{ complaint.message }}</td>
              <td class="text-center">
                <button class="btn btn-danger d-block mx-auto"  (click)="deleteComplaint(complaint)">Delete Complaint</button>
              </td>
            </tr>
          </tbody>
        </table>
      </div>
    </ng-container>
    <ng-template #noComplaints>
      <p class="text-center">No complaints found.</p>
    </ng-template>
    <div class="text-center">
      <p>Total Complaints: {{ filteredComplaints.length }}</p>
    </div>
  </div>
</div>

</div>
<div class="after-form-spacing1"></div>
